import React from 'react';
import IdeasCards from './IdeasCards/ideas.js'
import Feedback from './Feedback/feedback.js'
import BestDests from './BestDests/bestdests.js'
import Discount from './discountCarousels/discount.js'
import "./content.css";

class Content extends React.Component{
  constructor() {
  super();
  this.state = { data: [] };
  }
  componentDidMount() {
    fetch(`/`)
      .then(res => res.json())
      .then(json => this.setState({ data: json }));
    }
  render() {
    for (var key in this.state.data){
      if (key == "dest"){
        const dest = this.state.data.json
      }
    }
    console.log(dest)
    return (
      <div className="content container" id="home-content">
        <BestDests json={dest}/>
        <Discount/>
        <IdeasCards/>
        <Feedback />
      </div>

    );
  }
}
export default Content
